import logo from './logo.svg';
import './App.css';
import React from 'react';
import About from './component/About';


function App() {
  return (
      <div className="App">
        <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        </header>
        <div className='Intro'>Hola</div>

          <div><About /></div>

      </div>
  );
};
export default App;
